import React from "react";
import "./Gobackbtn.css";

const Gobackbtn = props => {
  return (
    <div className="goback-btn fa-chevron-circle-left">
      <i class="fal fa-chevron-circle-left"></i>
      <input
        className="button"
        type="button"
        value=""
        onclick="history.back(-1)"
      />
    </div>
  );
};

export default Gobackbtn;
